import React from 'react';

function Theme() {
    const onClick = (e) => {
        const { value } = e.target;
        console.log(value);
        setTheme = () => { document.documentElement.className = e.target };
    }

    return (
        <div className="color" onClick={(e) => onClick(e)}>
            <div className="red" value="theme-red"></div>
            <div className="orange" value="theme-orange"></div>
            <div className="yellow" value="theme-yellow"></div>
            <div className="green" value="theme-green"></div>
            <div className="blue" value="theme-blue"></div>
            <div className="indigo" value="theme-indigo"></div>
            <div className="violet" value="theme-violet"></div>
            <div className="black" value="theme-grey"></div>
        </div>
    )
}

export default Theme;
